import './server/server';
import Home from './pages/Cars/Home';
import About from './pages/Cars/About';
import Cars, { loader } from './pages/Cars/Cars';
import CarDetails from './pages/Cars/CarDetails';
import DashBoard from './pages/Host/DashBoard';
import Income from './pages/Host/Income';
import Reviews from './pages/Host/Reviews';
import HostCars from './pages/Host/HostCars';
import HostCarDetails from './pages/Host/HostCarDetails';
import HostCarInfo from './pages/Host/HostCarInfo';
import HostCarPricing from './pages/Host/HostCarPricing';
import HostCarPhotos from './pages/Host/HostCarPhotos';
import Login from './pages/Login';
import Layout from './components/Layout';
import HostLayout from './components/HostLayout';
import NotFound from './pages/Notfound';
import { createBrowserRouter, RouterProvider, createRoutesFromElements, Route, redirect } from 'react-router-dom';
import './styles/App.css';
import Error from './components/Error';

const router = createBrowserRouter(createRoutesFromElements(
   <Route path='/' element={<Layout />}>
              <Route index element={<Home />} />
              <Route path='about' element={<About />} />
              <Route
               path='cars' 
               element={<Cars />} 
               loader={loader}
               errorElement={<Error />}
               />
              <Route path='cars/:id' element={<CarDetails />} />
              <Route 
               path='/host' 
               element={<HostLayout />}
               >
                 <Route 
                     index 
                     element={<DashBoard />}
                     loader={async () => {
                        return null;
                     }}
                 />
                 <Route 
                     path='income' 
                     element={<Income />}
                     loader={async () => {
                        return null;
                     }}
                  />
                 <Route 
                     path='reviews' 
                     element={<Reviews />}
                     loader={async () => {
                        return null;
                     }}
                     />      
                 <Route 
                     path='cars' 
                     element={<HostCars />}
                     loader={async () => {
                        return null;
                     }} 
                     />
                 <Route 
                     path='cars/:id' 
                     element={<HostCarDetails />}
                     loader={async () => {
                        return null;
                     }}
                  >
                    <Route 
                        index 
                        element={<HostCarInfo />}
                        loader={async () => {
                           return null;
                        }}
                     />
                    <Route 
                        path='pricing' 
                        element={<HostCarPricing />}
                        loader={async () => {
                           return null;
                        }}
                     />
                    <Route 
                        path='photos' 
                        element={<HostCarPhotos />}
                        loader={async () => {
                           return null;
                        }}
                     />
                 </Route>
              </Route>
            <Route path='/login' element={<Login />} />
           <Route path='*' element={<NotFound />} />
          </Route>
));

export default function App() {
  return (
    <RouterProvider router={router} />
  );
}
